def calculate_consensus_category(column, importance_threshold=0.7):
    """
    Calculate the consensus category for a column based on specified criteria.

    Args:
    - column: pandas Series representing a column of data.
    - importance_threshold: Threshold for the importance of the most important category.

    Returns:
    - Consensus category for the column.
    """
    category_counts = column.value_counts()
    total_values = column.count()

    # Sort categories by importance (ascending order)
    categories_sorted = category_counts.index.sort_values()

    # Initialize consensus category
    consensus_category = None

    # Calculate the proportion of category 0
    proportion_category_0 = category_counts.get(0, 0) / total_values

    # Check if the importance threshold is met for category 0
    if proportion_category_0 >= importance_threshold:
        consensus_category = 0
    else:
        # Iterate over categories (excluding category 0)
        for category in categories_sorted:
            # If category is 0 or not in the category counts, skip
            if category == 0 or category not in category_counts:
                continue

            category_proportion = category_counts[category] / total_values

            # Check if the importance threshold is met for the category
            if category_proportion >= importance_threshold:
                consensus_category = category
                break

    # If consensus category is still None, assign to the next category
    if consensus_category is None:
        # Find the next available category
        next_category = min(categories_sorted)
        for category in categories_sorted:
            if category > next_category:
                next_category = category
                break
        consensus_category = next_category

    return consensus_category


